import React from "react";
import "./currentpollution.css";
const CurrentPollution = ({ data }) => {
  const dataInfo = data.list[0];
  return (
    <>
      <h1>Current Pollution</h1>
      <div className="weather">
        <div className="aqi">
          <label htmlFor="" className="aqi_label">
            Air Quality Index
          </label>
          <p className="aqi__element">{dataInfo.main.aqi}</p>
        </div>
        <div class="each__gas">
          <div class="each__gas__element">
            <div class="box d"> ashort data</div>
            <div class="box e">ba really long piece of data</div>
            <div class="box f">cshort data</div>
          </div>

          <div class="each__gas__element">
            <div class="box d">short data</div>
            <div class="box e">a really long piece of data</div>
            <div class="box f">short data</div>
          </div>
        </div>
      </div>
    </>
  );
};

export default CurrentPollution;
